import React from 'react'
import Link from 'next/link'
import styled from 'styled-components'
import { Button } from '../styles/button'
import { Page } from '../styles/Page'

const Zumthor = () => {
    return (
        <Page>
            
            <Nav>
                <Logo>
                    Zumthor
                </Logo>
                <Link href='/login'>
                    <NavButton>
                        Entrar
                    </NavButton>
                </Link>
                
            </Nav>
            
            <Main>
                <Title>
                    Zumthor
                </Title>
                <SubTitle>
                    Crie experiências espaciais para seus clientes e usuários com a ajuda da inteligência artifical.
                </SubTitle>
                <Actions>
                    <Link href='/login'>
                        <EnterButton>
                            Entrar
                        </EnterButton>
                    </Link>
                    <SearchButton>
                        Ver projetos
                    </SearchButton>
                </Actions>
            </Main>  
                                    
        </Page>
    )
}

export default Zumthor

const Nav = styled.div`
    max-width: 900px;
    width: 90%;
    height: 15vh;
    display: flex;
    align-items: center;
    justify-content: space-between;
`
const Logo = styled.h2``
const NavButton = styled(Button)`
    width: 100px;
    background: white;
    color: #333;
`
const Main = styled.main`
    max-width: 900px;
    width: 90%;
    min-height: 85vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`
const Title = styled.h1`
    font-size: 72px;
    margin-bottom: 24px;
`
const SubTitle = styled.h2`
    font-size: 24px;
    text-align: center;
    font-weight: normal;
`
const Actions = styled.div`
    display: flex;
    max-width: 600px;
    width: 100%;
    align-items: center;
    justify-content: center;
    padding: 25px;
`
const EnterButton = styled(Button)`
    margin-right: 7.5px;
    
`
const SearchButton = styled(Button)`
    margin-left: 7.5px;
    background: #5f5f5f;
`
